INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 0, 1, 2, 0, "春咲 ひより", 0, 0, 1001);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 1, "みんなみたいに\nわたしも強くならなきゃ", 1.4, 0, 1, 2, 0, "草野 優衣", 0, 0, 1002);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 1, "フェンシングを始めてみては？", 1.4, 0, 1, 2, 0, "士条 怜", 0, 0, 1003);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 1, "ねぇ、にいちゃん！", 1.5, 0, 1, 2, 0, "穂高 みそぎ", 0, 0, 1004);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "私といっしょに…\nいかない？", "ねぇ…", 1, "風宮あかりです", 1.4, 0, 1, 2, 0, "風宮 あかり", 0, 0, 1006);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "食べ物の恨みは怖いのー", "プリンたべたいのー", 1, "出雲宮子なのー", 1.5, 0, 1, 2, 0, "出雲 宮子", 0, 0, 1007);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 1, "ボクは虹村雪。", 1.4, 0, 1, 2, 0, "虹村 雪", 0, 0, 1008);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, "フッ…聞いて後悔するがいい！", 1.4, 0, 1, 2, 0, "柊杏奈", 0, 0, 1009);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 0, 1, 2, 0, "姫宮 真歩", 0, 0, 1010);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 1, "衣之咲璃乃です！", 1.4, 0, 1, 2, 0, "衣之咲 璃乃", 0, 0, 1011);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 0, 1, 2, 0, "柏崎 初音", 0, 0, 1012);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 1, "ちょす！\n美波鈴奈だよ～♪", 1.4, 0, 1, 2, 0, "美波 鈴奈", 0, 0, 1016);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 1, "はいたーい。\n喜屋武香織さー。", 1.4, 0, 1, 2, 0, "喜屋武 香織", 0, 0, 1017);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 1, "支倉伊緒です。", 1.4, 0, 1, 2, 0, "支倉 伊緒", 0, 0, 1018);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 0, 1, 2, 0, "茜 ミミ", 0, 0, 1020);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 0, 1, 2, 0, "栗林 くるみ", 0, 0, 1021);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 1, "風宮よりです。\nあああああ！", 1.4, 0, 1, 2, 0, "風宮 より", 0, 0, 1022);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 0, 1, 2, 0, "北条 綾音", 0, 0, 1023);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 1, "わっ…わっ…私、\n天野すずめといいます！", 1.4, 0, 1, 2, 0, "天野 すずめ", 0, 0, 1025);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 1, "……クスクス…私は\n…倉石恵理子……", 1.4, 0, 1, 2, 0, "倉石 恵理子", 0, 0, 1027);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 0, 1, 2, 0, "佐々木 咲恋", 0, 0, 1028);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 1, "桜井望だよ！\nよろしくねっ", 1.4, 0, 1, 2, 0, "桜井 望", 0, 0, 1029);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 1, "デケデケデンっ！", 1.4, 0, 1, 2, 0, "ニノン・ジュベール", 0, 0, 1030);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 1, "上喜しのぶです。\n手元のドクロが父です。", 1.4, 0, 1, 2, 0, "上喜 しのぶ", 0, 0, 1031);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 1, "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 0, 1, 2, 0, "野戸まひる", 0, 0, 1033);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 0, 1, 2, 0, "綾瀬 ゆかり", 0, 0, 1034);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 1, "氷川鏡華…です", 1.5, 0, 1, 2, 0, "氷川 鏡華", 0, 0, 1036);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 1, "柏崎…栞です。", 1.4, 0, 1, 2, 0, "柏崎 栞", 0, 0, 1038);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 1, "ふ、双葉碧です。", 1.4, 0, 1, 2, 0, "双葉 碧", 0, 0, 1040);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, "三角千歌です。", 1.4, 0, 1, 2, 0, "三角 千歌", 0, 0, 1042);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 1, "安芸真琴だ。", 1.4, 0, 1, 2, 0, "安芸 真琴", 0, 0, 1043);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 1, "わらわこそは夜を総べる者！", 1.4, 0, 1, 2, 0, "イリヤ・オーンスタイン", 0, 0, 1044);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 1, "そこで騎士は妖精を乱暴に……", 1.4, 0, 1, 2, 0, "遠見 空花", 0, 0, 1045);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 0, 1, 2, 0, "宮坂たまき", 0, 0, 1046);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 1, "大神美冬よ！", 1.4, 0, 1, 2, 0, "大神 美冬", 0, 0, 1048);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 1, "星野静流だよ！", 1.4, 0, 1, 2, 0, "星野静流", 0, 0, 1049);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 1, "アタシは玉泉美咲。", 1.5, 0, 1, 2, 0, "玉泉美咲", 0, 0, 1050);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "？？？？", "？？？？", 1, "？？？", 1.4, 0, 1, 2, 0, "リマ", 0, 0, 1052);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 1, 2, 0, "モニカ・ヴァイスヴィント", 0, 0, 1053);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 1, 2, 0, "ペコリーヌ", 0, 0, 1058);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 1, 2, 0, "コッコロ", 0, 0, 1059);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 1, 2, 0, "キャル", 0, 0, 1060);
